import React from "react";
import { Container, List, Elements, Links } from "./NavBarStyle";
const NavBar = () => {
    return (
        <Container>
            <List>
                <Elements>
                    <Links href="#">Home</Links>
                </Elements>
                <Elements>
                    <Links href="#">Sobre</Links>
                </Elements>
                <Elements>
                    <Links >Api's</Links>
                </Elements>
            </List>
        </Container>
    );
};

export default NavBar;
